import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import me from '../src/me.svg';
import notion1 from '../src/notion1.svg';
import notion2 from '../src/notion2.svg';
import notion3 from '../src/notion3.svg';
import Processsteps from './Processsteps';
import Process from './Process';
function Processcomponent() {
  const isSmallScreen = window.innerWidth <= 600; // Define your breakpoint here
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: "relative"}}>
     {isSmallScreen ? (
        <>
          <Grid item xs={12} md={12}>
            <Process />
          </Grid>
          <Grid item xs={12} md={12}>
            <Processsteps />
          </Grid>
        </>
      ) : (
        <Grid container spacing={2}>
          <Grid item xs={12} md={6}>
            <Process />
          </Grid>
          <Grid item xs={12} md={6}>
            <Processsteps />
          </Grid>
        </Grid>
      )}
    </Container>
  )
}

export default Processcomponent;
